  def self.ipsums # my own little joke, ipsum means self in Latin :)
    if @ipsums.nil?
      @ipsums = Hash[ 'ES', ES, 'EN', EN, 'FR', FR, 'PT', PT, 'LA', LA ]
      @ipsums.default = LA
    end
    @ipsums
  end


  def self.locales
    CiceroText.ipsums.keys
  end

  def self.text(locale = 'LA')
    CiceroText.ipsums[locale.upcase]
  end

